import React from 'react'; 
import {Card,CardGroup,CardDeck} from 'react-bootstrap';
// import './display.css';

class Display extends React.Component{
    state={
       images:''
    }
   
    render(){
        return(
            <div >
               <ul className='list-group horizontal'>
               <li className="list-group-item">
               
                   SpaceX : {this.props.passedData.map((s )=> {
                  
                       return(  
                        <div > 
                        
                         <CardGroup style={{display: 'flex', flexDirection: 'row'}}>
                        <Card style={{flex: 1}}>
                        <Card.Img variant="top" src={s.links.mission_patch_small} />
                        <Card.Body>
                          <Card.Title>Card Title</Card.Title>
                          <Card.Text>
                          {s.mission_name}
                           #
                          {s.flight_number}
                          <p>
                           Mission Ids : {s.mission_id} <br/>
                           Launch Year : {s.launch_year} <br/>
                           Successful Launch : "Yes" {s.rocket.rocket_id} <br/>
                           <p>Successful Landing :{s.rocket.first_stage.cores.land_success} </p>
                           </p>
                          </Card.Text>
                        </Card.Body>
                     </Card> 
                       </CardGroup>
       

</div>
                       )
                      
                  }) }
               </li>
               </ul>
               <style jsx>{`
    .horizontal {
     display:flex!important;
     flex-direction:row!important;
    }
    
  `}</style>
            </div>
 
        )
}
}

export default Display;


